import React, { Component } from 'react'
import Semibooks from './semibooks';
import imgs from  './img/book.png';
import './semibook.css';



class Seminew extends Component {
    state = {
        Books: [
            {bookName:'Amazonia' , writer: 'James Rollins', price: '3.99'},
            {bookName:'Beneath a scarlet sky' , writer: 'Mark Sullives', price: '3.99'},
            {bookName:'The Breathen' , writer: 'Alison agr',price: '3'},
            {bookName:'Virgen if the sun' , writer: 'Henririder', price: '3.99'},
            {bookName:'Make Money' , writer: 'Garth Stein',price: '3.99'}

        ]
    }
    render() {
        return (
            <div className='booklist'>

                <Semibooks bookName={this.state.Books[0].bookName} writer={this.state.Books[0].writer} price={this.state.Books[0].price}/>
                <Semibooks bookName={this.state.Books[1].bookName} writer={this.state.Books[1].writer} price={this.state.Books[1].price} />
                <Semibooks bookName={this.state.Books[2].bookName} writer={this.state.Books[2].writer} price={this.state.Books[2].price} />
                <Semibooks bookName={this.state.Books[3].bookName} writer={this.state.Books[3].writer} price={this.state.Books[3].price} />
                <Semibooks bookName={this.state.Books[4].bookName} writer={this.state.Books[4].writer} price={this.state.Books[4].price} />


            </div>

        );

    }
}

export default Seminew;
